import React, { useState } from 'react';
import { Divider, Steps, Button, Space, Card, Checkbox, Col, Form, Input, DatePicker, Radio } from 'antd';
import ListWapper from "../common/ListWapper";
import AppRowContainer from '../../@crema/core/AppRowContainer';
import { useIntl } from 'react-intl';
import { AiFillEdit } from "react-icons/ai";
import { useSelector, useDispatch } from 'react-redux'
import { useNavigate } from "react-router-dom";
import { getProfile } from '../../store/AuthRedux'
import IntlMessages from '../../@crema/utility/IntlMessages';





const Registration = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch()
  const { messages } = useIntl()

  const [current, setCurrent] = useState(0);
  const onChange = (value) => {
    console.log('onChange:', current);
    setCurrent(value);
  };

  const onFinish = (values) => {
    values['loginType'] = "email"
    dispatch(adminLogin(values))
  };
  const description = 'This is a description.';
  const [value, setValue] = useState(1);
  const onChanges = () => {
    console.log('radio checked', e.target.value);
    setValue(e.target.value);
  };





  return (
    <ListWapper>
      <div className='participation'>
        <h3>REGISTRATION</h3>
        <h3> Welcome to our easy 3 step registration!</h3>

        {/* <Steps
          current={current}
          onChange={onChange}
          items={[
            {
              title: 'Step 1',
              description,
            },
            {
              title: 'Step 2',
              description,
            },
            {
              title: 'Step 3',
              description,
            },
          ]}
        />

        <Divider />

        <Steps
          current={current}
          onChange={onChange}
          direction="vertical"
          items={[
            {
              title: 'Step 1',
              description,
            },
            {
              title: 'Step 2',
              description,
            },
            {
              title: 'Step 3',
              description,
            },
          ]}
        /> */}

        <Card className='login-card login-card-lg'>
          <AppRowContainer>
            <Col xs={24} lg={24}>
              <div className='form-sec'>
              <Form
                className='login-form'
                name='basic'
                initialValues={{ remember: true }}
                onFinish={onFinish}
              >
                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <Input placeholder="Name" />
                </Form.Item>

                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <DatePicker onChange={onChange} placeholder="DD/MM/YYYY" />

                </Form.Item>
                <Form.Item label="Radio">
                <Radio.Group name="radiogroup" defaultValue={1}>
                
                  <Radio value={1}>Male</Radio>
                  <Radio value={2}>Female</Radio>
                  <Radio value={3}>Prefer not to say</Radio>
                </Radio.Group>
                </Form.Item>
                <br/>
                <br/>

                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <Input placeholder={messages['common.name']} />
                </Form.Item>

                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <Input placeholder={messages['common.name']} />
                </Form.Item>

                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <Input placeholder="School" />
                </Form.Item>

                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <Input placeholder="Pincode" />
                </Form.Item>

                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <Input placeholder="State" />
                </Form.Item>

                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <Input placeholder="State" />
                </Form.Item>

                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <Input placeholder="Mobile Number*" />
                </Form.Item>

                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <Input placeholder="Email address" />
                </Form.Item>

                <Form.Item
                  name='name'
                  className='form-field'
                  rules={[
                    { required: true, message: 'Please input your Name!' },
                  ]}>
                  <Input placeholder="Re-enter Email address" />
                </Form.Item>



                <Button
                  type='primary'
                  className='login-form-btn'
                  htmlType='submit'>
                  <IntlMessages id='common.signup' />
                </Button>
              </Form>
              </div>
            </Col>
          </AppRowContainer>
        </Card>


        <h3>Are you currently teaching ?</h3>

        <Space className='button-sec'>
          <Button type="primary">Yes</Button>
          <Button>No</Button>

        </Space>

      </div>



    </ListWapper>
  );
};


export default Registration;
